import React from 'react';

class Test1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            jokes: {

            }
         }
    }
    componentDidMount(){
        fetch('https://api.chucknorris.io/jokes/random')
            .then(response =>response.json())
            .then(data => {
                this.setState({
                    jokes:data
                })
            })
    }
    render() { 
        return ( 
            <div>{this.state.jokes.value}</div>
         );
    }
}
 
export default Test1;
